        static void drawer(int[,] ingave, int vlaktelvl)
        {


            for (int row = 0; row < ingave.GetLength(0); row++)
            {
                Console.ForegroundColor = ConsoleColor.Green;


                for (int col = 0; col < ingave.GetLength(1); col++)

                {

                    bool ding = false;
                    int getal = r.Next(0, (vlaktelvl - row));


                    if ((row + 1) == ingave.GetLength(0))
                    {
                        ingave[row, col] = 2;
                        ding = true;

                    }

                    if ((col > 1) && (ingave[row, (col - 1)] == 1) && (ding == false) && ((col + 1) == ingave.GetLength(1)))
                    {
                        ingave[row, col] = 1;
                        ding = true;
                    }

                    if ((row > 0) && (col > 0) && ((col + 1) < ingave.GetLength(1)))
                    {


                        if ((ingave[(row - 1), col] == 1) && (ding == false))
                        {
                            ingave[row, col] = 1;



                            ding = true;

                        }
                        if ((ingave[(row - 1), (col - 1)] == 1) && (ding == false) && (ingave[row, (col - 1)] == 1))
                        {
                            ingave[row, col] = 1;
                            ding = true;
                        }
                        if ((ingave[(row - 1), (col + 1)] == 1) && (ding == false) && (ingave[(row - 1), col] == 0))
                        {
                            ingave[row, col] = 1;
                            ding = true;
                        }


                    }
                    if (ding == false)
                    {


                        if ((getal == 1) && (row > 20) && (col > 40) && ((col + 2) < ingave.GetLength(1)))
                        {
                            ingave[row, col] = 1;

                        }

                    }



                }

            }
        }//einde drawer
        static Random r = new Random();
        static void elementen(int[,] ingave)
        {
            for (int row = 0; row < ingave.GetLength(0); row++)
            {
                for (int col = 0; col < ingave.GetLength(1); col++)
                {
                    if ((row > 0) && (col > 0) && ((col + 1) < ingave.GetLength(1)))
                    {

                        if ((ingave[row, col] == 1) && ((ingave[(row - 1), (col + 1)] == 1) || (ingave[(row - 1), (col - 1)] == 1)))
                        {

                            int element = r.Next(1, 500);

                            if (element == 1 || element == 2 || element == 3 || element == 4 || element == 5 || element == 6)
                            {
                                ingave[row, col] = 3;
                            }
                            if (element == 7 || element == 8 || element == 9)
                            {
                                ingave[row, col] = 4;
                            }
                            if (element == 10)
                            {
                                ingave[row, col] = 5;
                            }



                        }
                    }
                }
            }

        }// einde elementen 

        static void tekending(int[,] ingave)
        {
            string blok = "█";
            for (int row = 0; row < ingave.GetLength(0); row++)
            {

                for (int col = 0; col < ingave.GetLength(1); col++)
                {

                    if (ingave[row, col] == 1)
                    {
                        Console.ForegroundColor = ConsoleColor.DarkGray;
                        Console.Write(blok);

                    }
                    else if (ingave[row, col] == 2)
                    {
                        Console.ForegroundColor = ConsoleColor.Green;
                        Console.Write(blok);
                    }
                    else if (ingave[row, col] == 3)
                    {
                        Console.ForegroundColor = ConsoleColor.Black;
                        Console.Write(blok);//k
                    }
                    else if (ingave[row, col] == 4)
                    {
                        Console.ForegroundColor = ConsoleColor.Gray;
                        Console.Write(blok);
                    }
                    else if (ingave[row, col] == 5)
                    {
                        Console.ForegroundColor = ConsoleColor.Yellow;
                        Console.Write(blok);
                    }
                    else
                    {
                        Console.Write(" ");
                    }

                }

            }
        }// einde tekendingd
    }

